import React from 'react'
import ReactDOM from 'react-dom'
import {res2} from './responsive_02.js'
import { Heading } from './heading.js'
import { current_user } from './index.js'
import img from './account.png'
export class Track_progress extends React.Component{
    constructor(){
        super()
        this.state={}
    }
    resize(){
        this.setState({})
    }
    render(){
        return(
            <>
            <Heading/>
            <Stats/>
            </>
        )
    }
}
class Stats extends React.Component{
    constructor(){
        super()
        this.state={style:res2.stats.header,image:res2.stats.image(img)}
    }
    render()
    {
        return<div style={this.state.image}>
        </div>
    }
}
